import React, { useState } from 'react';
import "./App.css";
import { Routes, Route } from "react-router-dom";
import Navbar from './Navbar';
import ContactPage from './Contact';
import Home from './Home';

const App = () => {
  const [formData, setFormData] = useState(null);

  const saveData = (data) => {
    // Save the form data in local storage or perform any desired action
    setFormData(data);
  };

  const clearLocalStorage = () => {
    // Clear the data stored in local storage or perform any desired action
    setFormData(null);
  };

  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Home clearLocalStorage={clearLocalStorage} storedData={formData} />} />
        <Route path="/contact" element={<ContactPage saveData={saveData} />} />
        <Route path="/task" element={<Task />} />
      </Routes>
    </div>
  );
};

export default App;
